import React from 'react';

import Grid from '@material-ui/core/Grid';

import { 
    HeaderProfileContainer,
    GridContainer,
    FlagContainer,
    Capacete2,
    Capacete1,
    BronzeFlag,
    TextFlagContainer,
    Elo,
    Pdl,
    Queue,
    CheckoutOrderBoxContainer,
    CheckoutHeader
  } from './calculator-styles';

import bronzeflag from "assets/bronze_flag.svg";
import capacete1 from "assets/Bronze/Capacete_1.png";
import capaceteFlag from "assets/Bronze/Capacete_2.png";

const Calculator = () => {
  return (
    <HeaderProfileContainer>
      <GridContainer>
        <Grid container spacing={2}
          direction="row"
          justify="center"
          alignItems="center">
          <Grid item xs={12} s={12} md={4}>

          </Grid>
          <Grid item xs={12} s={12} md={4}>

          </Grid>
          <Grid item xs={12} s={12} md={4}>
            <CheckoutOrderBoxContainer>
              <CheckoutHeader>

              </CheckoutHeader>
            </CheckoutOrderBoxContainer>
          </Grid>
        </Grid>
      </GridContainer>

    </HeaderProfileContainer>
  );
}

export default Calculator;
